actionConfiguration.body:
() =>{
		if (!appsmith.store.serialList){
			return [];
		}

		return appsmith.store.serialList.map((serial) =>{
			return {
				materialSubLot: {code: serial},
				carrier:{code:CarrierSelect.selectedOptionValue },
				storageLocation: {name: FetchWarehouse.data.data.queryEquipment[0].name}
			}
		})

	}

